INSERT INTO `drupal_supercron_enabled_mods` VALUES (29,'w3c_validator',28,'','<!-- Using Krumo Skin: skins/default/skin.css -->\n<style type=\"text/css\">\n<!--/**/\n/**\r\n* Krumo Default Skin\r\n*\r\n* @version $Id: skin.css,v 1.1.2.2 2008/06/03 20:36:05 weitzman Exp $\r\n* @author Kaloyan K. Tsvetkov <mrasnika@users.sourceforge.net>\r\n*/\r\n\r\n/* -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- */\r\n\r\nul.krumo-node {\r\n	margin: 0px;\r\n	padding: 0px;\r\n	}\r\nul.krumo-node ul {\r\n	margin-left: 20px;\r\n	}\r\n* html ul.krumo-node ul {\r\n	margin-left: 24px;\r\n	}\r\ndiv.krumo-root {\r\n	border: solid 1px black;\r\n	margin: 1em 0em;\r\n	}\r\nul.krumo-first {\r\n	font: normal 12px arial;\r\n	border: solid 2px white;\r\n	border-top-width:1px;\r\n	background: url(/sites/all/modules/devel/krumo/skins/default/bg.gif);\r\n	}\r\n\r\n/* -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- */\r\n\r\nli.krumo-child {\r\n	display:block;\r\n	list-style: none;\r\n	padding: 0px;\r\n	margin: 0px;\r\n	overflow:hidden;\r\n	}\r\ndiv.krumo-element {\r\n	cursor:default;\r\n\r\n	line-height: 24px;\r\n	display:block;\r\n	\r\n	clear:both;\r\n	white-space:nowrap;\r\n	\r\n	border-top: solid 1px white;\r\n	background: #E8E8E8;\r\n	padding-left: 10px;\r\n	}\r\n* html div.krumo-element {\r\n	padding-bottom: 3px;\r\n	}\r\na.krumo-name {\r\n	color:#2C5858;\r\n	font: bold 13px Arial;\r\n	}\r\na.krumo-name big {\r\n	font: bold 20pt Georgia;\r\n	line-height: 14px;\r\n	position:relative;\r\n	top:2px;\r\n	left:-2px;\r\n	}\r\n* html a.krumo-name big {\r\n	font: bold 19pt Georgia;\r\n	top: 5px;\r\n	left: 0px;\r\n	line-height: 9px;\r\n	height: 12px;\r\n	padding: 0px;\r\n	margin: 0px;\r\n	}\r\ndiv.krumo-expand {\r\n	background: #CCCCCC;\r\n	cursor:pointer;\r\n	}\r\ndiv.krumo-hover {\r\n	background: #B7DBDB;\r\n	}\r\n\r\n/* -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- */\r\n\r\ndiv.krumo-preview {\r\n	font: normal 13px courier ne